import React from 'react';
import { useNavigate } from 'react-router-dom';
import { 
  ChevronRight, 
  UserCircle, 
  Lock, 
  Settings, 
  LogOut, 
  ArrowLeft 
} from 'lucide-react';

const Profile = ({ user, theme }) => {
  const navigate = useNavigate();
  const isDark = theme === 'dark';

  // Dynamic color palette based on your design screenshots
  const colors = {
    background: isDark ? '#0f172a' : '#f8fafc',
    cardBg: isDark ? '#1e293b' : '#ffffff',
    textPrimary: isDark ? '#ffffff' : '#1e293b',
    textSecondary: isDark ? '#94a3b8' : '#64748b',
    border: isDark ? '#334155' : '#f1f5f9',
    iconBg: isDark ? '#2d3748' : '#f0f7ff',
    primaryBlue: '#5c5cfc'
  };

  const menuItems = [
    { icon: <UserCircle size={20} />, label: "Edit Profile", path: "/edit-profile" },
    { icon: <Lock size={20} />, label: "Change Password", path: "/change-password" },
    { icon: <Settings size={20} />, label: "Settings", path: "/settings" },
  ];

  const styles = {
    container: { 
      padding: '20px', 
      paddingBottom: '100px', 
      backgroundColor: colors.background, 
      minHeight: '100vh',
      transition: 'background-color 0.3s ease'
    },
    header: { display: 'flex', justifyContent: 'space-between', alignItems: 'center', marginBottom: '20px' },
    headerTitle: { fontSize: '18px', fontWeight: 'bold', margin: 0, color: colors.textPrimary },
    profileCard: { 
      backgroundColor: colors.cardBg, 
      borderRadius: '24px', 
      padding: '30px 20px', 
      textAlign: 'center', 
      boxShadow: isDark ? 'none' : '0 10px 15px -3px rgba(0,0,0,0.05)',
      border: `1px solid ${colors.border}`
    },
    avatarWrapper: { 
      width: '90px', 
      height: '90px', 
      borderRadius: '50%', 
      border: `2.5px solid ${colors.primaryBlue}`, 
      margin: '0 auto', 
      padding: '4px' 
    },
    avatar: { width: '100%', height: '100%', borderRadius: '50%', objectFit: 'cover' },
    name: { fontSize: '20px', fontWeight: 'bold', margin: '15px 0 5px 0', color: colors.textPrimary },
    email: { color: colors.textSecondary, fontSize: '13px', margin: '0 0 12px 0' },
    badge: { 
      backgroundColor: colors.primaryBlue, 
      color: '#fff', 
      padding: '4px 15px', 
      borderRadius: '20px', 
      fontSize: '12px', 
      fontWeight: 'bold' 
    },
    infoBox: { 
      backgroundColor: colors.cardBg, 
      borderRadius: '16px', 
      padding: '16px', 
      marginTop: '20px', 
      border: `1px solid ${colors.border}` 
    },
    infoRow: { display: 'flex', justifyContent: 'space-between', fontSize: '12px', marginBottom: '10px' },
    label: { color: colors.textSecondary },
    value: { fontWeight: 'bold', color: colors.textPrimary },
    menuItem: { 
      display: 'flex', 
      alignItems: 'center', 
      backgroundColor: colors.cardBg, 
      padding: '12px 16px', 
      borderRadius: '16px', 
      marginBottom: '10px', 
      border: `1px solid ${colors.border}`, 
      cursor: 'pointer' 
    },
    iconBox: { 
      backgroundColor: colors.iconBg, 
      padding: '8px', 
      borderRadius: '12px',
      color: colors.primaryBlue
    },
    menuText: { flex: 1, marginLeft: '12px', fontSize: '14px', fontWeight: '600', color: colors.textPrimary }
  };

  return (
    <div style={styles.container}>
      {/* Top Navigation Bar */}
      <div style={styles.header}>
        <ArrowLeft size={24} onClick={() => navigate(-1)} style={{ cursor: 'pointer', color: colors.textPrimary }} />
        <h2 style={styles.headerTitle}>Profile</h2>
        <div style={{ width: 24 }}></div>
      </div>

      {/* User Branding Card */}
      <div style={styles.profileCard}>
        <div style={styles.avatarWrapper}>
          <img 
            src="https://images.unsplash.com/photo-1494790108377-be9c29b29330?w=150" 
            alt="User" 
            style={styles.avatar} 
          />
        </div>
        <h3 style={styles.name}>{user.name}</h3>
        <p style={styles.email}>{user.email}</p>
        <span style={styles.badge}>Student</span>
      </div>

      {/* Academic Info */}
      <div style={styles.infoBox}>
        <div style={styles.infoRow}>
          <span style={styles.label}>College Name</span>
          <span style={styles.value}>{user.college}</span>
        </div>
        <div style={styles.infoRow}>
          <span style={styles.label}>Register Number</span>
          <span style={styles.value}>{user.regNo}</span>
        </div>
      </div>

      {/* Menu List */}
      <div style={{ marginTop: '20px' }}>
        {menuItems.map((item, index) => (
          <div key={index} style={styles.menuItem} onClick={() => navigate(item.path)}>
            <div style={styles.iconBox}>{item.icon}</div>
            <span style={styles.menuText}>{item.label}</span>
            <ChevronRight size={18} color="#cbd5e1" />
          </div>
        ))}
        
        {/* Logout Button */}
        <div style={styles.menuItem} onClick={() => alert("Logging out...")}>
          <div style={{...styles.iconBox, backgroundColor: isDark ? '#451a1a' : '#fff1f2', color: '#ef4444'}}>
            <LogOut size={20} />
          </div>
          <span style={{...styles.menuText, color: '#ef4444'}}>Logout</span>
          <ChevronRight size={18} color="#cbd5e1" />
        </div>
      </div>
    </div>
  );
};

export default Profile;
